import { useEffect, useState } from "react";
import { getAllEmp } from "../Service/service";
import Emp from "./emp";

export default function DisplayEmp() {
  const [emps, setemps] = useState([]);

  useEffect(() => {
    getAllEmp().then((data) => {
      setemps(data);
    });
  }, []);

  return (
    <>
    {
        emps.map(emp => {return <Emp empName={emp.name} empRole={emp.role}></Emp>})
    }
    </>
  );
}
